import logo from "./logo.svg";
import "./App.css";
import Item from "./components/Items";
import ItemDate from "./components/ItemDate";

function App() {
  const response = [
    {
      itemName: "Nirma",
      ItemDate: "20",
      itemMonth: "June",
      itemYear: "1998",
    },
    {
      itemName: "apple",
      ItemDate: "24",
      itemMonth: "July",
      itemYear: "19986",
    },
    {
      itemName: "pulks",
      ItemDate: "23",
      itemMonth: "Aug",
      itemYear: "2004",
    },
  ];

  // const itemTwoName = "surfexcel";
  return (
    <div>
      <Item name={response[0].itemName}></Item>
      <ItemDate
        day={response[0].ItemDate}
        month={response[0].itemMonth}
        year={response[0].itemYear}
      ></ItemDate>

      <Item name={response[1].itemName}></Item>
      <ItemDate day="22" month="July" year="1999"></ItemDate>

      <Item name={response[2].itemName}></Item>
      <ItemDate day="23" month="August" year="2000"></ItemDate>
      <div className="App">hello ggg</div>
    </div>
  );
}
export default App;
